import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Navbar from './Navbar/Navbar';
import Footer from './footer/Footer';
import Home from './Home';
import AboutUs from './Nav-Links/AboutUs';
import ContactUs from './Nav-Links/ContactUs';
//Computing and Engineering Sciences
import ComputingSteps from './ComputingSteps/ComputingSteps';
import Requirements from './ComputingSteps/Requirements';
import SchoolOfficer from './ComputingSteps/SchoolOfficer';
import HeadOfDepartment from './ComputingSteps/HeadOfDepartment';
import BabcockUniversityTeachingHospital from './ComputingSteps/BabcockUniversityTeachingHospital';
import DirectorStudentSupportServices from './ComputingSteps/DirectorStudentSupportServices';
import DirectorSecurityServices from './ComputingSteps/DirectorSecurityServices';
import DataandArchievesOfficer from './ComputingSteps/DataandArchievesOfficer';
import AdmissionsOfficer from './ComputingSteps/AdmissionsOfficer';
import SchoolOfficer2 from './ComputingSteps/SchoolOfficer2';

//Mass Comm
import MassSteps from './MassSteps/MassSteps';
import Requirements1 from './MassSteps/Requirements1';
import SchoolOfficer1 from './MassSteps/SchoolOfficer1';
import HeadOfDepartment1 from './MassSteps/HeadOfDepartment1';
import BabcockUniversityTeachingHospital1 from './MassSteps/BabcockUniversityTeachingHospital1';
import DirectorStudentSupportServices1 from './MassSteps/DirectorStudentSupportServices1';
import DirectorSecurityServices1 from './MassSteps/DirectorSecurityServices1';
import DataandArchievesOfficer1 from './MassSteps/DataandArchievesOfficer1';
import AdmissionsOfficer1 from './MassSteps/AdmissionsOfficer1';
import SchoolOfficer3 from './MassSteps/SchoolOfficer3';

import Scrolltotopofsteps from './scrolltotop/scrolltotopofsteps';
import SignUp from './accounts/SignUp';
import LogIn from './accounts/LogIn';
import SelectCourse from './SelectCourse';
import NotFound from './NotFound';
import Computing from "./Computing";
import MassComm from "./MassComm";
import { AuthProvider } from './contexts/AuthContext';
import PrivateRoute from './PrivateRoute';
// import Successful from './Successful'
import ForgotPassword from './accounts/ForgotPassword';

function App() {
  return (
      <Router>
        <AuthProvider>
        <div className="App">
          <Scrolltotopofsteps />
          <div className="content">
          <Navbar></Navbar>
            <Switch>
              <Route exact path = '/'>
                  <Home />
                  <Footer></Footer>
              </Route>

              <Route path = '/AboutUs'>
                  <AboutUs />
                  <Footer></Footer>
              </Route>

              <Route path = '/ContactUs'>
                  <ContactUs />
                  <Footer></Footer>
              </Route>

              {/* <PrivateRoute path = '/Successful' component = {Successful} /> */}

              {/* Computing and engineering sciences*/}
              <PrivateRoute path = '/ComputingSteps' component = {ComputingSteps} />
              <PrivateRoute path = '/Requirements' component = {Requirements} />
              <PrivateRoute path = '/SchoolOfficer' component = {SchoolOfficer} />
              <PrivateRoute path = '/HeadOfDepartment' component = {HeadOfDepartment} />
              <PrivateRoute path = '/BabcockUniversityTeachingHospital' component = {BabcockUniversityTeachingHospital} />
              <PrivateRoute path = '/DirectorStudentSupportServices'  component = {DirectorStudentSupportServices} />
              <PrivateRoute path = '/DirectorSecurityServices'  component = {DirectorSecurityServices} />
              <PrivateRoute path = '/DataandArchievesOfficer'  component = {DataandArchievesOfficer} />
              <PrivateRoute path = '/AdmissionsOfficer'  component = {AdmissionsOfficer} />
              <PrivateRoute path = '/SchoolOfficer2'  component = {SchoolOfficer2} />

              {/*Mass Comm*/}
              <PrivateRoute path = '/MassSteps' component = {MassSteps} />
              <PrivateRoute path = '/Requirements1' component = {Requirements1} />
              <PrivateRoute path = '/SchoolOfficer1' component = {SchoolOfficer1} />
              <PrivateRoute path = '/HeadOfDepartment1' component = {HeadOfDepartment1} />
              <PrivateRoute path = '/BabcockUniversityTeachingHospital1' component = {BabcockUniversityTeachingHospital1} />
              <PrivateRoute path = '/DirectorStudentSupportServices1'  component = {DirectorStudentSupportServices1} />
              <PrivateRoute path = '/DirectorSecurityServices1'  component = {DirectorSecurityServices1} />
              <PrivateRoute path = '/DataandArchievesOfficer1'  component = {DataandArchievesOfficer1} />
              <PrivateRoute path = '/AdmissionsOfficer1'  component = {AdmissionsOfficer1} />
              <PrivateRoute path = '/SchoolOfficer3'  component = {SchoolOfficer3} />

              <Route path = '/SignUp' component = {SignUp} />

              <Route path = '/LogIn' component = {LogIn} />

              <Route path = '/ForgotPassword' component = {ForgotPassword} />

              <PrivateRoute path = "/SelectCourse" component = {SelectCourse} />

              <PrivateRoute path = "/Computing" component = {Computing} />

              <PrivateRoute path = "/MassComm" component = {MassComm} />

              <Route path = "*">
                <NotFound />
              </Route>
            </Switch>
          </div>
        </div>
        </AuthProvider>
      </Router>
  );
}

export default App;
